var findMinArrowShots = function(points) {
    let newArray=[];
    points.sort((a,b)=> a[0]-b[0])
    // console.log(points);
    
    newArray[0]=points[0]
    for(let i=1;i<points.length;i++){
        if(newArray[newArray.length-1][0]<=points[i][0]&&newArray[newArray.length-1][1]>=points[i][0]){
            if(newArray[newArray.length-1][1]>=points[i][1]){
                newArray[newArray.length-1]=points[i]
            }else{
                newArray[newArray.length-1][0]=points[i][0]
            }
        }else{
            newArray.push(points[i])
        }
        // console.log(newArray);
        
    }  
    // console.log(newArray);
    
    return newArray.length
};
